"description": "Upcycled Wooden Guitar Wall Hanger - Available in Blue, Yellow & Purple\n\nThis is a handmade, recycled wood, wall mount guitar hanger that is finished with bright colored paint and finished with a beach driftwood look.  Other paint colors available on request.  Hangers are approximately 3.5&quot; x 5.5&quot;\n\nI started making these to hang my (too many) guitars and other stringed instruments, before realizing how popular they were.\n\nI have used these guitar hangers to hang my banjos, electric guitars (Fender, Gibson, Ibanez, Epiphone, Peavey, etc..) basses, and acoustic guitars (both 6 and 12-string).  If you have any questions about the fit of a certain instrument, please feel free to ask.  \n\nWe are not responsible for the secure hanging of your musical instrument.  Please choose the appropriate hardware for your specific installation, and mount securely.  The hanger is mounted using two screws into your wall... preferably into a stud, but I have used heavy duty drywall anchors successfully as well.\n\n**Please note: The U hook will be uninstalled for safe shipping purposes and will need to be reinstalled after you receive the item.  The wood may not be the exact stain color as the picture. Each piece of wood stains slightly different.  If you have any concern regarding color matching existing décor, please let us know and we can send a preview before mailing.***",
