"description": "• 3 large accessory pockets for strings & more\n• Also holds up to 15 picks (plectrums)\n• Space enough for a fingerpicks tin\n• Choice of four styles\n• Also suitable for banjo accessories\n\nThis real leather guitar accessories wallet is specially designed for all the things every guitarist needs. It has three pockets, plus a picks holder that holds up to 15 picks (plectrums). The largest pocket holds a full set of spare strings. The second pocket is designed to hold a large capo* and/or a slide. A third pocket behind the pick holder takes cards and cash. These pockets are all nice and big (11cm/4&quot;) and will take many other items, such as an electronic tuner, fingerpicks tin, string winder, slide, etc. The wallet is still small enough to fit in the strings compartment of a hardshell guitar case.\n\nThis guitar strings wallet uses two bovine leathers. The main leather is 1mm thick vegetable tanned leather. The picks holder is made from a slightly thicker nubuck or similar with good spring to hold the picks nice and tight. The wallet is held closed with a high quality one inch elastic strap.\n\nComes in a cotton gift bag with either a free pick holder keyring, or a metal fingerpicks tin. See the options.\n\n• Rod&#39;s guarantee: If you don&#39;t love it, send it back! All costs refunded.\n• Designed and hand-crafted in Hebden Bridge, Yorkshire, England.\n• We ship worldwide, usually in 2 days\n• Check out our feedback - click the ***** button above.\n• Phone 07973 154888 (UK) or message me anytime for more details.\n\nTech spec:\nItem size: 120x120x15mm (4.5&quot; x 4.33&quot; x 0.5&quot;)\nItem weight: 85g (3oz) average\n\n*Many guitar players have a capo to help them play in different keys. It clamps across strings on the fretboard, and makes the whole guitar play at a higher pitch. Banjo players also use them.",
