"sale_message": "Thanks for buying one of our cases!    It will be in the post in the next 3 days or I&#39;ll let you know otherwise.  \r\n\r\n If the item is for yourself, we hope you enjoy using it for a good long time.  If it&#39;s a gift for someone else, we hope they really like it too.   We&#39;ve put a lot of effort into making sure our items are well designed and well made, and we offer complete refund on return of the item if you are not 100% happy.  We mean it!  :-)\r\n\r\nPlease let us have your feedback!  Use pinegrove.co.uk if you prefer.\r\n\r\nFor the latest updates, like us on Facebook  at https://www.facebook.com/PinegroveLeather or follow us on Twitter at https://twitter.com/PinegroveLeathr\r\n\r\nBest wishes,\r\nRod and Lou",
"digital_sale_message": null,
"last_updated_tsz": 1477059559,
"listing_active_count": 33,
"digital_listing_count": 0,
"login_name": "pinegroveleathr",
"accepts_custom_requests": false,
"policy_welcome": "Thank you for visiting the Pinegrove Leather shop.  We hope you find our pieces interesting, useful and good-looking.   They feel good too!   Our philosophy is simply to make beautiful things for people to enjoy.   We also believe they should be well made and long lasting, so we use high quality leather and strong thread.   The hardware (buckles etc) we use is high quality too, for example solid brass rather than plated.\r\n\r\nIf you have any questions, please ask.  It will help us to improve our service.\r\n\r\nThanks,\r\nRod",
"policy_payment": "For details on buying from Etsy, see http://www.etsy.com/help_guide_checkout.php\r\n",
"policy_shipping": "We will dispatch orders within 48 hours.   If there&#39;s stock shortage, we&#39;ll let you know what&#39;s happening and give you the option to cancel.\r\n\r\nIf you have paid using Paypal, and your Etsy and Paypal address differ, please let us know in the &quot;message to seller&quot; note during checkout.  If you do not notify us and we cannot reach you within 48 hours after payment we will ship the item to the address provided during Etsy checkout. \r\n\r\nAll items are sent via UK Royal Mail once your payment has been completed.  Typically it takes 10 days internationally.\r\n\r\nPlease let us know if you want insured or signed-for delivery.  We will let you know the additional postage cost as soon as possible.\r\n\r\nOrdering multiple items:\r\nWe have not specified postage for additional items as this will be dependent on the size and weight of the actual items ordered.   We will email you with the total cost after we receive your order.  You will then be able to change your order if you want to.  \r\n\r\nNon-UK customers:\r\nUK post office mailing prices are split into three world regions: \r\n- Europe, including all of the CIS, Turkey and Georgia.\r\n- World Zone 1: Generally covers North America, South America, Africa, Arabia and most of Asia.\r\n- World Zone 2: Australia, New Zealand, Singapore and Pacific Islands.\r\n\r\nTo calculate postage costs yourself, use http://www.royalmail.com/price-finder.\r\nIn Step 1, select &quot;Overseas&quot;.  \r\nIn Step 2, select &quot;Small packet&quot; and the weight value stated in the product listing.  \r\nIn Step 3, select &quot;within 10 days&quot; in the top box and &quot;Less than £50&quot; in the bottom box.\r\nFinally click &quot;Find price&quot;.   Price options will then appear below.\r\n\r\nFrom these, let me know which you want to use.   &quot;International Signed For&quot; or &quot;Airsure&quot; is recommended.  For all other postage types we will be able to provide proof of postage as a matter of course.  \r\n\r\nCustoms (Non-UK customers only): \r\nBeware - your country may charge customs duty.  This will not necessarily happen but we need to warn you it is a possibility and nothing to do with Pinegrove Leather. If you are concerned about this, please check out  http://www.dutycalculator.com.   \r\n",
"policy_refunds": "If you are not 100% satisfied with your case then return it within 28 days in its original packaging for a full refund including the return postage costs or a replacement.   Otherwise we expect it to last a long long time!\r\n\r\nSee note below in Additional Information.",
"policy_additional": "Please note that leather is an organic material and has the naturally occurring marks of any genuine animal skin: this is part of its natural beauty.   Where hair-on cowhide is part of the design, we have carefully chosen the pattern that will appear on every piece, and provide customers with options in terms of the balance of brown, white etc. ",
