"creation_tsz": 1441826147,
"title": "Random Rompers",
"announcement": "Welcome to Random Rompers!  Production time to make these handmade beauties is currently at 3 weeks. New styles release 2-4 times a month on Friday mornings 10am CST  so be sure to keep and eye out for new styles. All items are limited and most don&#39;t restock so if you see some you like, don&#39;t wait to long to snag them!  Follow me on Instagram from sneak peaks of new styles and sales updates.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Taking a break to catch up on orders and reduce the turn around times. Shop will reopen 04/01 in the meantime be sure to follow me on Instagram for upcoming new styles, sales and information. ",
"sale_message": "Thank you so much for your support of my shop! These handmade beauties are made to order at the time of purchase. Rompers ship between 2-3 weeks after being ordered. ",
"digital_sale_message": null,
"last_updated_tsz": 1477059443,
"listing_active_count": 18,
"digital_listing_count": 0,
"login_name": "KrysandSher",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to Random Rompers. HOW IT WORKS:\r\n1. Make Sure you are following me on Instagram @randomrompers. There, during the week Monday-Thursday I post pictures of the rompers that will be available for sale on Friday mornings. In those postings I will tell you the fabric type and color, accent colors, and how much the romper will cost. All the rompers get posted at the same time Friday mornings at 9am CST here on Etsy.\r\n2. Rompers sale out quickly so if you don&#39;t see them in the store they are most likely sold out.\r\n3. Quantities are always limited unless its a preorder because I buy fabric usually on sale  or close out so I can offer you the best price. \r\n4. Be sure to read the full description of all the fabrics \r\n5. be sure to read the size chart ",
"policy_payment": "1. All payments are processed through Etsy.\r\n2. Cancelations will not be allowed if the fabric has already been cut. if a cancelation is excepted I will refund you in 5 or less business days.\r\n3. If coupon codes are used incorrectly the whole order can be cancelled without notice. A refund will be sent.\r\n\r\nCOUPON CODE RULES\r\n1. The add code, ADDTOORDER Is for use when you have purchased a preorder during that week. If at any time the code is used out of context the order will be cancelled without warning. a refund will be sent. if you are unsure if you can use it please ask before using. THE CODE IS FOR USA ORDERS ONLY COMBINING SHIPPING FOR INTERNATIONAL IS NOT ALLOWED. \r\n2. Codes cannot be combined. You can only apply one code to an order.\r\n3. If you forget to use a code the code cannot then be reapplied to the order. Please be sure to make sure you have everything correct before checking out. \r\n4. Brand rep and Brand Enthusiast codes can only be used by the rep they were given to, for rompers purchased for themselves. any violation of that will result in the order being cancelled and code disabled.\r\n\r\n\r\n\r\n",
"policy_shipping": "TURN AROUND TIME and SHIPPING COSTS\r\nTurn around time from order date to shipment date is currently 14-21 days \r\n1. Domestic USA, shipping starts at $3.25 and increases with the amount of rompers ordered.\r\n2. Canada Shipping starts at $5.00 and increases with the amount of rompers ordered.\r\n3. World wide shipping starts at $7.50 and increases with the amount of rompers ordered. \r\n\r\nSHIPPING UPGRADES\r\nDomestic USA shipping has the option to upgrade to Priority shipping which starts at $6.75 and increase with each romper. NOTE: This does not change the sewing turn around time. \r\n\r\nSHIPPING POLICY\r\nShipments are sent through USPS first call mail. You will receive a tracking number once the order is shipped. WE ARE NOT REPSONISBLE FOR LOST OR STOLEN MAIL, MAIL THAT IS NOT DELIEVERED DUE TO INCORRECT ADDRESS, OR ANY OTHER MAILING MISTAKES ONCE THE ROMPERS ARE AT THE POST OFFICE.\r\n\r\nINTERNATIONAL MAIL\r\nI have tried to calculate the shipping cost correctly, if the final cost of shipping is $2.00 or more over what you originally paid I will invoice you for the remaining balance. The order will not be sent without the remaining balance being paid. WE DO NOT COVER ANY CUSTOMS/VAT COST AND ARE NOT REPONSIBLE FOR HOW LONG OR IF CUSTOMS HOLDS THE PACKAGE. INTERNATIONAL ORDERS ARE FINAL, NO REFUNDS OR EXCHANGES. WE ARE NOT REPSONISBLE FOR LOST OR STOLEN MAIL, MAIL THAT IS NOT DELIEVERED DUE TO INCORRECT ADDRESS, OR ANY OTHER MAILING MISTAKES ONCE THE ROMPERS ARE AT THE POST OFFICE.",
"policy_refunds": "I want you to be completely happy with your order. Claims for refund, exchange, credit etc... must notify me within 7 days of the delivery confirmation date to be excepted. What problem can be refunded or credited:\r\n\r\n1. Construction problems, all rompers are hand made by me so occasionally sewing mistakes are made. if you find anything wrong we can make it right doing 1 of following 3 ways \r\n1. I can credit you 1/2 the price for the romper and explain to you easy fixes which can usually be done with a needle and thread. \r\n2. I can fix the romper for you. I can send you a return label and envelope for you to send the romper back to me so I can quickly fix and return to you, normally within 2-5 days of receiving the romper.\r\n3. You can return the romper for a refund. If you choose the return the romper, I will cover the return shipping (USA domestic only)  and send the refund after the romper has been received. NOTE: the romper must not be washed, stained, or damaged in anyway (other than the issue you are returning the romper for) to qualify for a refund. \r\n\r\nWhat will NOT to refunded or credited:\r\n1. Problems with sizing. There is a size chart for you to view if you are in question. If you order the wrong size that will not will refunded or credited\r\n2. Color or fabric. I always make sure to mention the fabrics content and weight and also if the color is something other then the picture shows.\r\n\r\nINTERNATIONAL ORDERS ARE STRICTLY NO REFUNDS, NO EXCHANGES\r\n",
"policy_additional": "HAND WASH AND LAY FLAT TO DRY \r\nIf you have any problems or concerns please let us know ASAP. \r\nCustom orders are normally not permitted",
"policy_seller_info": "",
"policy_updated_tsz": 1460145394,
"policy_has_private_receipt_info": false,
"vacation_autoreply": "You are receiving this message automatically,\r\nThe shop is currently on vacation until 04/01 as I catch up on all open orders. All current orders are on schedule to ship out on time. You can find your ship date on your etsy receipt. All orders had a 4 week turn around time. If you have any other questions regarding your current order I will get back to you as soon as I can. In the meantime be sure to follow me on Instagram @randomrompers for more information, sales, and sneak peaks of new rompers when I reopen.\r\nThank you,\r\nKrystal ",
