"title": "1&quot;x1 1/4&quot; (25MMx32MM) Guitar Pick Stamping Blanks, 22g Stainless Steel - AWESOME Silver Alternative GP10-08",
"description": "Choose 10, 20, 40, 100 or 400 Qty. (just above &quot;Add to Cart&quot; button) of 1&quot;x1 1/4&quot; (25MMx32MM) Guitar Pick Stamping Blanks, 22g Stainless Steel - AWESOME Silver Alternative!\r\n\r\nSHIPPING OPTIONS: www.etsy.com/shop/StampingBlanks?section_id=8013999\r\n\r\nAVAILABLE HOLE PUNCHES:\r\nPremium Punch KIT - www.etsy.com/shop/StampingBlanks/search?search_query=Premium+Kit\r\nPremium Punch ONLY - www.etsy.com/shop/StampingBlanks/search?search_query=ONLY\r\nPower Punch KIT - www.etsy.com/shop/StampingBlanks/search?search_query=&quot;Power+Punch&quot;+Kit\r\n\r\nPUNCH ACCESSORIES:\r\nPremium Punch MOUNT - www.etsy.com/shop/StampingBlanks/search?search_query=Mount\r\nIndividual Punch Pin/Die - www.etsy.com/shop/StampingBlanks/search?search_query=Individual\r\n\r\nMORE SHAPES: stampingblanks.etsy.com\r\n\r\nUsing our very shiny stainless steel blanks will allow you to offer your customers products that are beautiful & very affordable. For many years luxury watchmakers have appreciated that stainless steel is an excellent choice for producing quality jewelry. It is hypo allergenic, does not rust, change color or tarnish. And because it is so durable, items crafted with it can be treasured for a lifetime.\r\n\r\nNOTES:\r\n1. Our blanks ship with an easy to peel vinyl film to protect the shiny side until you are ready to use them and are made in the USA.\r\n\r\n2. If you are using GOOD QUALITY SHARP STAMPS, you only have to hit them slightly harder than you do for stamping silver, copper or brass - www.etsy.com/shop/StampingBlanks/search?search_query=&quot;Stamp+Set&quot;\r\n\r\n3. Stainless steel is a very strong durable metal and does not easily bend, which are very desirable qualities. However punch hole pliers & screw down punches will not work. The punches I have listed are modified so the hole can be set to 1/16&quot; from the blank edge (orig. only 1/4&quot; min.) & the pin opening is coated to prevent marring the blank. Hole punching is quick & easy in stainless steel & whatever other metal you&#39;re using. Demo video&#39;s: stampingblanks.com/StampingBlanks-How-To-Videos",
