"title": "David Gilmour’s Black Stratocaster Limited Edition Fine Art Print A3 size",
"description": "This A3-sized Limited Edition Fine Art Print features a detailed hand drawn illustration of David Gilmour’s Black Stratocaster, by George Morgan.\n\nThis print comes from a limited edition print run consisting of just 95 pieces. Each print will be signed and individually numbered by hand in soft pencil by the artist prior to despatch. \nProduced on thick 300 gsm silk art paper this Limited Edition Print is suitable for framing with or without a mount and will be supplied in a protective cellophane bag inside a sturdy cardboard postal tube.\n\nDavid Gilmour’s Black Stratocaster.\nDavid purchased this Black Stratocaster in New York during Pink Floyd’s 1970 North American tour. This 1969 model with maple fingerboard and large headstock was originally finished in sunburst and had been refinished in black at Manny’s. Making its debut at the Bath Festival in June 1970, David has had most of the components changed over the years including the fingerboard, pickups, tuners, pickguard, bridge and tremolo arm. It was also modified with different selector switches and a Gibson PAF humbucker in the 70’s. Widely regarded as his favourite guitar, David has played this Black Strat on numerous recordings and live performances throughout his time with Pink Floyd and as a solo artist.\n\nSize 420mm x 297mm (16.54&quot; x 11.69&quot;)",
