"title": "Handmade Pottery Mug ceramics and pottery Banjo Mug green and brown by Jewel Pottery",
"description": "Handmade Pottery Banjo mug, made to order so you can pick your colors from my shop. If you do not convo me about the color of the mug, it will be made in dark green with a brown top as the 1st pic shows! Thanks!\n\nby Jewel Pottery\n\nMade to order ready to ship in 2-3 weeks,  if you need one sooner convo me I may have one or be able to get it out sooner, or check out my ready to ship section https://www.etsy.com/shop/jewelpottery?ref=listing-shop2-all-items-count§ion_id=5940735\n\nHI FOLKS, I AM UPDATING MY LISTINGS,, FIRST WITH SO MANY MUGS ON ETSY WHY BUY MY MUGS??\n\nWell, as an artist specializing in mugs for 23 years I look at mugs a lot. Here is what I can tell you; my mugs are well thought out and cater to function. Here are the reasons why you should buy one of my pottery mugs and feel the difference;\n\n1. The handles are thicker, more comfortable to hold than others, hand pulled (not extruded) and fit snug in the grove of your hand. You can fit your hand into them and they are very comfortable to hold. \n\n2. White inside for easy cleaning and you can see that it is clean.\n\n3. The lip of the mug is rounded and the size of the lip is not to big or too thin, well made for easy sipping\n\n4. The size of my mugs is right about 14-16 oz,, most are about 16 but I say 14 to be on the safe side. If yours is made to order tell me you want 16 or 8oz and I will make it that way. 16 oz fits most cans or bottles of beverages. \n\n5. They keep coffee good and hot, and with the comfort of the handle you will not have to figure a way to hold your hot mug.\n\n6. The colors are vibrant and alive, soon to become your favorite mug on the shelf. All mugs are dishwasher and microwave safe.\n\n7. My designs are made from hand carved stamps not from a rubber stamp made in a factory\n\n8. I have put a lot thought into the design and colors. I think you will notice the difference. If your not completely satisfied, send it back and I will make you another or refund your money. \n\nI learned to throw clay on the potter&#39;s wheel in college,, many late nights eating pizza by the wheel. After college I moved to Seagrove NC to become a professional potter. I practiced on a wheel that was once Dorothy Auman Cole&#39;s. She was a 7th generation potter. Dorothy had passed before I got there. However her ware that had not been glaze fired was in a chicken coop near where I worked. Every day I would start the day examining one of her pieces with my hands closing my eyes finding the piece. She created ware that was exceptionally functional and beautiful. I believe she guided me and helped me to be where I am today. Thank you Dorothy\n\nCanadian buyers; Shipping has increased drastically very sorry but 14.75 per mug is what it costs to ship, thanks\n\n\nTHIS LISTING IS FOR THESE MUGS ONLY. IF YOU WOULD LIKE TO ORDER CUSTOM MUGS PLEASE USE THE LISTING: https://www.etsy.com/listing/233113975/handmade-pottery-mug-personalized-mug?ref=shop_home_active_2&ga_search_query=customized%2Bname%2Bmug",
