"title": "Guitar, Snowman, Ornament, Violin, Baby Bottle & Potion Bottle Cookie Cutter Designed By Whisked Away Cutters - **Guideline Sketches Below**",
"description": "When a customer asked if I could design a guitar cutter, I had in mind to do one that would be sturdy and not susceptible to cookie breakage. As you can see, I had fun coming up with different uses for this cutter as well.\n\nI will be including Guideline Sketches should anyone wish to use either as as guide as soon as I can get them posted. You will find them under the photos of the cutter. To save them, click on the photo, right click to either &quot;Save Image&quot; or &quot;Copy Image&quot;. From there paste into Word or whichever program you like. You can then resize it from there as needed and then print it to either follow along or to place on a KopyKake.\n\nWhisked Away Cutters are finely crafted cutters for cookies and fondant, designed by a cookie decorator for cookie decorators. Crafted with rounded corners on the handle for comfort, a reinforced area near the base of the handle and strong walls going down to a fine tapered edge for a precise, clean cut. Please see the cutter side view example in the close up photo of The Vicki plaque cutter shown above in the thumbnail photos.\n\n** Food safe PLA cutters are HAND WASH ONLY, not dishwasher safe, cannot be used to cut hot and should not be left to soak in hot water. This is an aspect of all food safe PLA cutters. Care must be given to the specialized tapered cutting edge when storing as it can get nicked or damaged if hit with another cutter or sharp object. Proper care will ensure years of use from your Whisked Away Cutters. \n\nMaryann, The Cookie Artisan, recently had this to say, &quot;I love how your cutters feel in my hands and how comfortable the edges feel as I cut cookies! Used my first cutter to cut 350 cookies and the edges on the last cookie looked as great as the first cookie!&quot;\n\nCutter prices are determined by print time and the amount of PLA used. Cutters with intricate shapes and curves or larger sizes take longer to print and are priced accordingly. \n\nCurrent shipping time is shown on our home page beneath the banner at https://www.etsy.com/shop/whiskedawaycutters  Shipping for our shop is done via USPS First Class Mail, which is listed as 3 - 5 days on average. Priority Mail is listed as 2 - 3 days on average and is available for purchase as a separate item. Again, shipping times are not guaranteed. Please bear in mind the normal order processing time that is shown. We will make all efforts to expedite your order when Priority Mail is selected, but it will be a matter of the number of orders already placed. Please see &quot;Shipping & Policies&quot; for more shop information.",
