"title": "Finely crafted cookie cutters and fondant cutters",
"announcement": "Thank you for stopping by Whisked Away Cutters!  Our current processing time before shipping is 2 - 3 days, but I will ship out sooner when at all possible.  Welcome to Whisked Away Cutters, finely crafted cutters designed by a cookie decorator for cookie decorators!  You can see all designs on Instagram @WhiskedAwayCutters or at www.facebook.com/WhiskedAwayCutters.  Our shop was born out of the need to have precise and unique cutter shapes for my professional cookie business, The Cookie Connoisseur LLC.  Over the years I have been asked by many if they could purchase my cutters and now we are able to have them to offer for sale.\r\n\r\nWhisked Away Cutters are designed by a cookie decorator for cookie decorators with steps taken to produce a top level product.  Although they could be produced faster and less expensive, our cutters are designed with smooth strong walls, an additional reinforced area where the handle is attached and then going down to an all-important thinner tapered cutting edge.  This makes for a smooth, clean cut with excellent results.  Admittedly, our cutters are a tad ‘overdesigned’ due to these efforts, but we feel that it makes for a product that we feel good putting our name on and decorators will be happy to use.\r\n\r\nOur cutters produced with a 3d printer and are made with the highest quality food safe PLA, a food grade plant based plastic.  They require certain care in they are HAND WASH ONLY and are not dishwasher safe, as that can damage or melt the PLA.  Along those lines they are not to be soaked in hot water, used to cut hot cookies or exposed to high heat.  Hand washing in hot, soapy water is the proper care. As well, to prevent damage to the tapered edge, please store carefully in order that other cutters or additional items will not hit and damage them. Whisked Away Cutters is not responsible for damage caused by improper care of the cutters.  Proper care will ensure a long, happy life for your cutters.\r\n\r\n__________________________________________________________________\r\nSHIPPING:\r\n*** Domestic Shipping: \r\nUSPS raised its rates on Jan. 17 and shipping changes have been made to meet those increases. We ship USPS First Class mail, which is stated as 3 - 5 business days.  Priority Mail is stated as 2 - 3 business days.  If you wish to have Priority Mail, please select that as a separate item when you place your order. https://www.etsy.com/listing/186158643/optional-priority-mail-shipping-upgrade?ref=shop_home_active_23\r\n\r\n***International Shipping: \r\n We are now shipping internationally via USPS First Class International as that is the best rate for the customer. USPS raised its rates on Jan. 17 and shipping changes have been made to meet those increases. Please be aware that there may be customs fees, duties or import taxes due by the customer when receiving an order from the U.S.  Your customs form will have the value including shipping listed on the box.   Each country will have a threshold before charging fees and it varies by country.  For example,  our understanding is that the U.K. has a low threshold of approximately $24, but  some countries will have a threshold of $200, so it is dependent upon the country.  Also, if applicable, please be aware that Royal Mail may charge a handling fee.  This does not show threshold, but shows fees for each country.  http://www.uscib.org/?documentID=1676 For more information on fees and taxes that you might incur within your country, please contact your local Post Office.  \r\n\r\nPlease allow two to six weeks for international shipping.  Tracking is provided, but only within the U.S.  Once it leaves the U.S., we cannot track it. If your box has not arrived within 45 days, please contact your local Post Office first.  If it does not arrive to you and is returned to us, we will reimburse the cost of the cutters minus the shipping.\r\n____________________________________________________________________\r\n\r\nCutter designs and photos of decorated cookies made with our cutters can be seen on our Facebook page at www.facebook.com/WhiskedAwayCutters. All cutter designs will be shown on Instagram @WhiskedAwayCutters\r\n\r\nThank you again for stopping by and we hope to be able to fill your cutter needs!\r\n\r\nWhisked Away Cutters is a subsidiary of The Cookie Connoisseur LLC, a licensed home based bakery located in Virginia, just outside of Washington, D.C.\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Thank you for stopping by Whisked Away Cutters!  Our shop is currently closed with plans to reopen on Thursday, Aug. 11.    \r\n\r\nThank you again for stopping by!  \r\n\r\nTake care  ~ \r\nTracy/Whisked Away Cutters",
"sale_message": "**Thank you for for your order!  Your support of our little cutter shop has been very sincerely appreciated!  We have an increase in orders so please note your listed processing time before shipping shown on your order and know that I am working away to get orders out ahead of the timeline when at all possible.  \r\n\r\nWelcome to Whisked Away Cutters, finely crafted cutters designed by a cookie decorator for cookie decorators!  You can see all designs on Instagram @WhiskedAwayCutters or at www.facebook.com/WhiskedAwayCutters.  Our shop was born out of the need to have precise and unique cutter shapes for my professional cookie business, The Cookie Connoisseur LLC.  Over the years I have been asked by many if they could purchase my cutters and now we are able to have them to offer for sale.\r\n\r\nWhisked Away Cutters are designed by a cookie decorator for cookie decorators with steps taken to produce a top level product.  Although they could be produced faster and less expensive, our cutters are designed with smooth strong walls, an additional reinforced area where the handle is attached and then going down to an all-important thinner tapered cutting edge.  This makes for a smooth, clean cut with excellent results.  Admittedly, our cutters are a tad ‘overdesigned’ due to these efforts, but we feel that it makes for a product that we feel good putting our name on and decorators will be happy to use.\r\n\r\nFor international buyers, please be aware that import fees, duties, taxes, etc. may be due upon receipt of your box.  The cost of your purchase plus shipping will be shown on the customs form attached to the outside of the box.  Please allow 2 - 6 weeks for international shipping. We very much appreciate your business and we ask that you please see &quot;Policies&quot; for more detailed information, if needed.\r\n\r\nAgain, thank you for your order and we hope that you enjoy your Whisked Away Cutters!",
