"policy_welcome": "Welcome to Whisked Away Cutters, born out of need to have finely crafted cutters for my cookie business, The Cookie Connoisseur LLC.  Our cutters are designed by a cookie decorator with attention paid to ensuing a precise, clean cut and a cutter that lasts for many years with proper care.  Our cutters have a reinforced area near the handle for extra strength and strong walls going down to an all-important taped edge giving that fine cut desired.",
"policy_payment": "Payments can be made with all major credit cards via Direct Checkout or through PayPal.",
"policy_shipping": "*** Domestic Shipping: \r\nWe ship USPS First Class mail, which is stated as 3 - 5 business days.  Priority Mail is stated as 2 - 3 business days.  If you wish to have Priority Mail, please select that as a separate item when you place your order: https://www.etsy.com/listing/186158643/optional-priority-mail-shipping-upgrade?ref=shop_home_active_23\r\n\r\nShipping days stated by USPS are not guaranteed. Please bear in mind the normal order processing time that is shown prior to shipping. We will make all efforts to expedite your order when Priority Mail is selected, but it will be a matter of the number of orders already placed.\r\n\r\nOnce your order is placed, you will be sent a confirmation number. Please use this for tracking your package, if desired.\r\n\r\nPlease allow 21 days before filing a claim for a lost package. \r\n\r\n\r\n***International Shipping: \r\n We are now shipping internationally via USPS First Class International as that is the best rate for the customer. Please be aware that there may be customs fees, duties or import taxes due by the customer when receiving an order from the U.S.  Your customs form will have the value including shipping listed on the box.   Each country will have a threshold before charging fees and it varies by country.  For example,  our understanding is that the U.K. has a low threshold of approximately $24, but  some countries will have a threshold of $200, so it is dependant upon the country.  This does not show threshold, but shows fees for each country.  http://www.uscib.org/?documentID=1676 For more information on fees and taxes that you might incur within your country, please contact your local Post Office. \r\n\r\nPlease allow two to six weeks for international shipping.  Tracking is provided, but only within the U.S.  Once it leaves the U.S., we cannot track it. If your box has not arrived within 45 days, please contact your local Post Office first.  If shipped to the correct address provided, If it does not arrive to you and is returned to us, we will reimburse the cost of the cutters minus the shipping.\r\n______________________________________________________________",
"policy_refunds": "Orders that are filled are not eligible for refunds. If a box arrives damaged, please let us know immediately. We will need  a photo of the damaged box and damaged cutters.  Cutters damaged in shipping will be replaced.\r\n\r\nWhisked Away Cutters is not responsible for cutters that are damaged due to improper washing, storage or use. Please read carefully the care instructions that come with your cutters.  ",
"policy_additional": "FAQs:\r\n\r\nDo you sell wholesale?\r\nDue to the time involved to produce our cutters, we do not sell wholesale.\r\n\r\nDo you take custom orders?\r\nAs we are just starting out and need to focus on adding our own new designs, we are not taking custom orders at this point.\r\n\r\nHow are prices determined?\r\nPrices are determined by the print time and amount of PLA used.  Cutters with intricate shapes and curves as well as larger cutters require substantially more print time and are priced accordingly.  ",
"policy_seller_info": "",
"policy_updated_tsz": 1409797691,
"policy_has_private_receipt_info": false,
"vacation_autoreply": "Thank you for stopping by Whisked Away Cutters!  Thank you for stopping by Whisked Away Cutters!  Our shop is currently closed with plans to reopen on Thursday, Aug. 11.  I will be checking messages and will respond as soon as I am able.   \r\n\r\nThank you for stopping by!  \r\n\r\nTake care,\r\nTracy\r\n~ Whisked Away Cutters",
