"title": "Blue Landscape Framed Mixed Media Collage Art Free USA shipping Ready to Hang",
"description": "Blue Landscape is an original mixed media artwork, matted, signed and framed on stretched canvas. This piece is part of a series of stitched collages I have made over my 30 year career. I often work with a mix of paper, fabric and transfers of my imagery, layered onto painted narrative text. All is then intricately stitched. For me, the rhythmic action of stitching in and out, back and forth, over and under, creates not only texture, but memory. The hand of the artist is always present, helping to reveal the story of the artwork. For this piece: Beginning with a journal entry on painted fabric, this woman was a reminder to me to value the processes of making, doing, being, living. Let it be your reminder!\n\nThe piece measures 10&quot; x 10&quot;, and was newly created for a recent collage exhibition, Piecing it All Together, and you can see it installed with a companion piece at the exhibit in the last picture. Here is a link to my blog post about the exhibit, with more pictures from the show: http://www.gaylepritchard.blogspot.com/2011/04/art-of-collage-exhibit-opening-crowded.html\nand the companion piece, Lady Blue, is listed in my shop here: https://www.etsy.com/listing/121472937/mixed-media-collage-lady-blue-framed-art\n\nFree domestic shipping is included in your purchase. Buy both pieces together, and receive 10% off: USE THIS CODE at checkout for your discount: COOLARTNOW\n\nMaterials: hand shibori dyed paper on canvas, paint, stitching, paper, guitar strings, beads, various threads, iridescent organza, metal rods and screening on canvas; found paper; transferred imagery on unprimed canvas, narrative text\n\nTechniques: Hand stitched, embroidered, appliqued, painted, collaged; drawing and writing on canvas, layered disperse dye image transfers. \n\nI have more mixed media artwork in my shop here: https://www.etsy.com/shop/NoMoonNight?ref=hdr_shop_menu&section_id=12660696\n\nThanks for looking. As an artist for the past 30 years, I have completed many custom commissioned artworks. Please contact me to create a special piece for you. See more on my website: www.gaylepritchardart.com\n\nIf you like vintage finds, please visit www.MyOddBits.etsy.com\n\nThanks!",
