"description": "This silver toned guitar bookmark is an affordable gift for music teachers, musicians and amateur guitar players.\n\nThe guitar bookmark comes with a Tibetan silver bookmark base, your choice of beads, and a silver toned heart charm. Check out our Metal Bookmarks section for more teacher bookmark options.\n\nLooking for more bookmarks? Check out our collection:\nhttps://www.etsy.com/shop/charmphilosophy\n\nLike our Charm Philosophy Facebook page: https://www.facebook.com/CharmPhilosophy to view updates on new products.\n\nOr, follow us on Twitter: twitter.com/CharmPhilosophy\n\nIf you&#39;re struggling for gift ideas, all of our products make great stocking stuffers. Follow this link to view more: www.etsy.com/shop/charmphilosophy\n\nFeel free to contact me with any questions. Most of our items can be customized.\n\n*** FREQUENTLY ASKED QUESTIONS ***\n\nQ: How can I track my package?\n\nI&#39;m sorry, we cannot provide a tracking number. We are shipping using Canada Post&#39;s Light Packet Parcel Service. In order to obtain tracking information, it costs anywhere from $17 to $66 in shipping fees, depending on where the package is being shipped to. If it is essential that you have a tracking number and are willing to pay the additional shipping fee, please contact me before purchasing.\n\nQ: Why hasn&#39;t my package arrived yet?\n\nWe are a Canada-based company. Items shipping from Canada take an average of about 10-14 days to arrive at it&#39;s destination. Please allow 3 weeks (or sometimes more) during the Christmas season, as the postal service and customs gets extremely backed up.\n\nQ: I want to buy a gift. Can I pay for priority shipping to get it here by the end of the week?\n\nWe offer an shipping upgrade add-on Canada Post&#39;s Xpresspost Service, which guarantees arrival in 4 business days. You can add that to your order here: http://etsy.me/1vCmGoc\n\nQ: Can I add additional charms or beads to my necklace?\n\nAbsolutely! View our Add-ons section to find the listings for both.\n\nQ: I want to buy in bulk. Do you have more of this item than what is listed?\n\nIn most cases, yes. Feel free to send me a inquiry.\n\nIf you have anymore questions, please ask :) Thank you for checking out Charm Philosophy.",
