"title": "Personalized Sterling Silver Jewelry and Gift Ideas",
"announcement": "Follow us on Instagram: @charmphilosophyjewelry\r\n\r\nPersonalized sterling silver necklaces, Celtic jewelry, small necklaces, teacher gifts, gift ideas, kids jewelry, Tibetan silver charm bookmarks, custom jewelry, and more!\r\n\r\nWe ship every Monday and Thursday.\r\n\r\nShipping to the USA: 3-6 on average (with tracking)\r\nShipping to Canada: 10-14 days on average (no tracking)\r\nShipping Internationally: 10-14 days on average (with tracking)\r\n\r\nPlease give yourself extra time around the holidays to order. We are not miracle workers (unfortunately) and we have no control over how fast a parcel can get to you, especially at busy times of year.\r\n\r\nKindly note that we cannot provide tracking numbers to Canadian buyers unless you purchase the shipping upgrade option: http://etsy.me/1aK9Os5\r\n\r\nSOCIAL MEDIA:\r\n\r\nFacebook - www.facebook.com/CharmPhilosophy\r\nTwitter - twitter.com/CharmPhilosophy\r\nPinterest - www.pinterest.com/nicole_CP\r\nInstagram - @charmphilosophyjewelry\r\n\r\nIf you have any custom ideas for us to add to our collection, please let us know!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "We will be on vacation from February 17 until March 25. Once we reopen, we will answer all questions sent during that time in the order that they were asked. Sorry for any inconvenience.",
"sale_message": "Thank you for purchasing from Charm Philosophy! We appreciate your business. \r\n\r\nWe ship every Monday and Thursday.\r\n\r\nShipping to the USA: 3-6 on average (with tracking)\r\nShipping to Canada: 10-14 days on average (no tracking)\r\nShipping Internationally: 10-14 days on average (with tracking)\r\n\r\nWe are shipping from Vancouver, BC, Canada.\r\n\r\nPlease take a moment to leave positive feedback when you receive your item(s). \r\nIf you&#39;re not satisfied with your purchase, please contact us. We&#39;ll do our best to correct any problems.\r\n\r\nSOCIAL MEDIA:\r\n\r\nFacebook - www.facebook.com/CharmPhilosophy\r\nTwitter - twitter.com/CharmPhilosophy\r\nPinterest - www.pinterest.com/nicole_CP\r\nInstagram - @charmphilosophyjewelry",
