"accepts_custom_requests": true,
"policy_welcome": "Welcome to our policies page!\r\n\r\nIf you have any special requests, requirements or alterations you&#39;d like to make to any of our pieces, please send us a convo. If we have the supplies, we&#39;ll do our best to bring your vision to life!",
"policy_payment": "Paypal , Credit Card or Etsy Gift Card.\r\n\r\nIf you pay with an eCheck, please allow up to 7 days for the check to clear. Your mailing address does not become available to Etsy sellers until the check has cleared, so we cannot ship early.",
"policy_shipping": "We will do our best to ship next day, but please allow 2-3 days for packaging and shipping in case of unexpected delays.\r\n\r\nThe buyer is responsible for any additional fees that may be charged at customs.\n\nThe buyer is responsible for providing the correct shipping address. If your order is lost due to an incorrect address, we will not reship or refund. \r\n\r\nPlease note that cross-border or international shipping, especially around the holidays, can take anywhere from two weeks to a month to arrive, and in some cases even longer when unexpected delays occur at the border or with the post office. We cannot guarantee that an item will arrive before a specific date, as once it is shipped, the package is out of our hands.\r\n\r\nIf you still have not received your package AFTER FOUR WEEKS, feel free to contact us.\r\n\r\nI&#39;m sorry, WE CANNOT PROVIDE TRACKING NUMBERS with Light Packet International Shipping. To obtain one, please purchase our upgraded shipping option: http://etsy.me/1aK9Os5",
"policy_refunds": "In case you are unsatisfied, please let us know before leaving neutral or negative feedback and we&#39;ll do our best to address the problem. \r\n\r\nYou can return an item within 30 days of purchase for a refund of the purchase price. Shipping fees are non-refundable. \r\n\r\nCustom items ordered upon request are non-refundable. Hand stamped items are only partially refundable.\r\n\r\nWe do not offer exchanges.\r\n",
