"description": "Original oil painting, hand painted by a professional portrait artist with 20+ years experience.  \n\n- Portraits in all shapes and sizes, scroll down to see sizes, custom sizes available\n- Ships in 2-4 weeks\n- Trained professional artist\n- Custom modifications available on request – change color, add/remove details etc.\n- Worldwide shipping\n- 100% satisfaction guaranteed \n\n\nTHE PROCESS\n\nSTEP 1 – The Ordering Process\nThe painting has sold. Your painting will be created in the same style, color and size as seen in the listing you purchased. Each reproduced painting may have unique minor variances but will stay very true to the original.\n\nSTEP 2 – The Painting Process\nYou’ve placed your order, and now my work begins. I use very high quality canvas and paint materials to bring your photograph to produce your painting. I use stunning oils in a process that uses a trained eye and a steady hand.  Most portraits can be finished within a 5-8 days although some extra time might be needed for drying. \n\nSTEP 3 – Delivery\nThe finished painting is carefully rolled and shipped in a tube. Gallery wrap  or  framing available at extra cost; see below. \n\n\n\nFRAMING\nPlease note, stretching and framing not included with purchase. Framing and gallery wrapping services I offer include:\n\nGallery wrapping - Your finished painting is stretched onto a solid wood frame with the canvas wrapped around the back and hanging hardware attached.  It arrives ready to hang. \n\nFraming - I work very closely with my preferred framer who has framed 100’s of my paintings; his price and craftsmanship are hard to beat. Your local framer would charge you close to twice the amount.  Convo me if you would like help in choosing a suitable.   High quality hand crafted Italian wood frames, professionally stretched and framed. \n\n** Send me a message for help in purchasing your gallery wrap or frame.",
